import { Grid, Cell } from 'react-mdl';
import '../App.css';


export default class AboutMe extends Component {
    render() {
        return (
            <Grid className="about-div">
                <Cell col={6}>
                    <h1>ABOUT ME</h1>
                    <hr style={{borderTop: '3px solid #833fb2', width: '50%'}}/>
                    <p>Highly motivated developer to prove herself in the IT industry.  Extreme hunger to learn new tools/technology. Sense of ownership & value creation
I have awesome experience in operating PSTN telecom switches for an Indian Government owned telecom company called BSNL.</p>
                </Cell>
            </Grid>
        )
    }
}
